(112128, 'ON/OFF', 'VIEW_COUNTER_ENABLED', 'true', '<center><b><h2>View Counter</h2><i>Developed by:</i><br>Jack York @ Oscommerce Solution<br><a href=\"//oscommerce-solution.com//check_unreleased_updates.php?id=1.6&name=ViewCounter\" target=\"_blank\">Check Updates</a></b></center><br>Site monitoring', 6132, 1, '2022-09-26 17:46:05', '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
(112129, 'Active Time', 'VIEW_COUNTER_ACTIVE_TIME', '10', 'The number of minutes to show active visitors.', 6132, 2, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112130, 'Autofill Create Account', 'VIEW_COUNTER_AUTOFILL', 'false', 'Autofill some of the fields on the create account and new address pages.<br>(true=on false=off)', 6132, 3, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
(112131, 'Bad Bot Trap', 'VIEW_COUNTER_BAD_BOT_TRAP', 'Email', 'Choose how to handle the bad bot trap.<br><br><b>Ban:</b> Ban the IP<br><b>Email:</b> Send an Email containing the IP<br><b>Both:</b> Both of the above<br><b>Off:</b> Nothing will be done', 6132, 4, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'Ban\', \'Email\', \'Both\', \'Off\'), '),
(112132, 'Block Countries Shop', 'VIEW_COUNTER_BLOCK_COUNTRIES_SHOP', 'Off', '<br><b>Off:</b> Not Enabled.<br><br><b>Internal Only:</b> Only use the internal database.<br><br><b>Internal & External:</b> Use the internal database and external sites. More likely to find the country but may slow the site down.', 6132, 5, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'Off\', \'Internal\', \'External\'), '),
(112133, 'Block Countries Allow Bots', 'VIEW_COUNTER_BLOCK_COUNTRIES_BOTS', 'Off', '<b>Off</b>: If block countries shop is enabled, block all, even search engines.<br><br><b>On</b>: If block countries shop is enabled, do not block search engines.', 6132, 6, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'Off\', \'On\'), '),
(112134, 'Countries Check Admin', 'VIEW_COUNTER_COUNTRIES_CHECK_ADMIN', 'Internal', '<br><b>Internal:</b> Only use the internal database.<br><br><b>External:</b> Use the internal database and external sites. This is more likely to find the country but may slow the site down.', 6132, 7, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'Internal\', \'External\'), '),
(112135, '<font color=purple>Data Skimmers Minimum Count (Pro Version Only)</font>', 'VIEW_COUNTER_DATA_SKIMMER_MIN_COUNT', '100', 'The minimum number of clicks before an IP is considered to be a skimmer.', 6132, 8, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112136, '<font color=purple>Data Skimmers Show Bots (Pro Version Only)</font>', 'VIEW_COUNTER_DATA_SKIMMER_SHOW_BOTS', 'false', 'Include search bots when evaluating skimmers. This may be useful to identify bad bots and spoofers. If enabled, be careful when banning any that show since they may be legitimate bots.<br>(true=on false=off)', 6132, 9, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
(112137, '<font color=purple>Data Skimmers Period of Time (Pro Version Only)</font>', 'VIEW_COUNTER_DATA_SKIMMER_PERIOD', '24', 'The amount of time, in hours, to check for skimmers. So 24 would mean to check the log for the last 24 hours.', 6132, 10, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112138, 'Date Format', 'VIEW_COUNTER_DATE_FORMAT', '%a, %D %T', 'The format of the displayed date and time. This requires a valid string so only change it if you are familiar with the format.<br><br><b>12 hr:</b> %a, %D %r => Sun, 14th 01:39:56 PM<br><b>24 hr:</b> %a, %D %T => Sun, 14th 13:39:56<br><br>', 6132, 11, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112139, 'Force Reset', 'VIEW_COUNTER_FORCE_RESET', '2', 'The maximum number of days to keep the IP\'s in the database. The View counter table will grow very large if not cleared and data over a few days is probably of no use.', 6132, 12, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112140, 'Force Reset Storage', 'VIEW_COUNTER_FORCE_RESET_STORAGE', '14', 'The maximum number of days to keep the IP\'s in the storage table. This table is used for reports. It will grow very large if not cleared on a regular basis.', 6132, 13, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112141, 'Good IP List', 'VIEW_COUNTER_GOOD_IP_LIST', '', 'Ignore these IP\'s when banning. Use a comma separated list for multiple IP\'s.', 6132, 14, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112142, 'Hide Admin Links', 'VIEW_COUNTER_HIDE_ADMIN_LINKS', '', 'Do not show admin links for these IP\'s. Use a comma separated list for multiple IP\'s.', 6132, 15, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112143, 'Item Name Length', 'VIEW_COUNTER_ITEM_NAME_LENGTH', '20', 'The length of the names of the categories, manufacturers and products used in the monitor and report sections.', 6132, 16, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112144, 'Kick Off', 'VIEW_COUNTER_ENABLE_KILL_SESSION', 'true', 'Enable the ability to kick off customers.', 6132, 17, '2022-09-26 18:33:40', '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
