(112146, 'Rows Per Page', 'VIEW_COUNTER_MAX_ROWS', '200', 'The maximum number of rows to display in the list.', 6132, 19, '2022-09-26 19:30:43', '2022-09-26 17:32:46', NULL, NULL),
(112147, 'Send Emails To', 'VIEW_COUNTER_SEND_EMAILS_TO', '', 'The email address any emails created by View Counter will be sent to. If left empty, the shops email address will be used.', 6132, 20, NULL, '2022-09-26 17:32:46', NULL, NULL),
(112148, 'Show Flags', 'VIEW_COUNTER_SHOW_FLAGS', 'true', 'Display the country flags. Turning this off will speed up the display. <br>(true=on false=off)', 6132, 21, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
(112149, 'Show Account Details', 'VIEW_COUNTER_SHOW_ACCOUNT_DETAILS', 'true', 'Display the account details of the visitor, if possible. If multiple accounts exist, they will all be shown. Enabling this option may cause a slow-down, depending upon the site. <br>(true=on false=off)', 6132, 22, NULL, '2022-09-26 17:32:46', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'), '),
