(1, 1, 'PERRO BAÃ‘O MEDIANO', '', '', '', '', '', '', NULL, 0),
(2, 1, 'ROYAL CANIN YORKSHIRE TERRIER PUPPY PERRO 500GR', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Yorkshire Terrier Puppy de ROYAL CANIN&reg; es un alimento indicado para perros de raza yorkshire terrier de hasta 10 meses de edad y ha sido espec&iacute;ficamente formulado teniendo en cuenta las necesidades nutricionales de perros j&oacute;venes de esta raza. El sistema inmunol&oacute;gico de tu perro se est&aacute; desarrollando, por eso Yorkshire Terrier Puppy de ROYAL CANIN&reg; contiene un complejo patentado de antioxidantes (que incluye la vitamina E) para reforzar sus defensas naturales durante este importante per&iacute;odo de crecimiento. La f&oacute;rmula de Yorkshire Terrier Puppy de ROYAL CANIN&reg; est&aacute; enriquecida con &aacute;cidos grasos omega 3 (EPA y DHA), &aacute;cidos grasos omega 6 (procedentes del aceite de borraja), as&iacute; como biotina, para ayudar a tu cachorro a mantener el buen estado de salud de su pelaje. Yorkshire Terrier Puppy de ROYAL CANIN&reg; tambi&eacute;n es beneficioso para su salud digestiva. Su f&oacute;rmula incluye nutrientes que incluyen prote&iacute;nas de alta calidad y muy digestibles (L.I.P.), as&iacute; como prebi&oacute;ticos (FOS), para favorecer el equilibrio de la flora intestinal. Adem&aacute;s, la croqueta exclusiva de Yorkshire Terrier Puppy de ROYAL CANIN&reg; tambi&eacute;n favorece la higiene dental de tu perro, ya que ralentiza la formaci&oacute;n de sarro.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Fortalecimiento del sistema inmunol&oacute;gico</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			El crecimiento es una etapa muy importante de la vida de tu cachorro: es una &eacute;poca de importantes cambios f&iacute;sicos y descubrimientos. Durante este per&iacute;odo clave, el sistema inmunol&oacute;gico del cachorro se desarrolla de forma gradual. Yorkshire Puppy contiene un complejo patentado de antioxidantes (que incluye vitamina E) que favorece las defensas naturales de tu cachorro mientras todav&iacute;a se est&aacute;n desarrollando.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Pelo sano</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula exclusiva contribuye a mantener la salud del pelo largo del Yorkshire. Enriquecida con niveles adaptados de &aacute;cidos grasos omega 3 (EPA y DHA), &aacute;cidos grasos omega 6, aceite de borraja y biotina.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Salud digestiva</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula contribuye a un buen funcionamiento digestivo y a promover el equilibrio de la flora intestinal.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style