(4, 1, 'ROYAL CANIN VETERINARY URINARY S/O PERRO 85GR', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Urinary S/O est&aacute; formulado espec&iacute;ficamente para ayudar a perros con sensibilidades urinarias como los c&aacute;lculos y cristales de estruvita. Esta f&oacute;rmula ayuda a disolver cualquier tipo de c&aacute;lculo de estruvita que pueda formarse en la vejiga.&nbsp; Esta dieta ayuda a diluir la orina de tu perro, haciendo menos probable la formaci&oacute;n de c&aacute;lculos de estruvita o de oxalato de calcio. Esta f&oacute;rmula contiene una baja SSR baja (sobresaturaci&oacute;n relativa) para ayudar a reducir la concentraci&oacute;n de iones que contribuyen a la formaci&oacute;n de cristales. Esta dieta tambi&eacute;n contribuye a un entorno urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y oxalato de calcio. &nbsp;Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition , solo debes dar este producto a tu mascota si te lo recomienda un veterinario profesional. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, el alimento h&uacute;medo ROYAL CANIN&reg; Urinary S/O tambi&eacute;n est&aacute; disponible en forma de textura suave similar a la del pat&eacute; o en forma de alimento seco con croquetas crujientes*. * Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Disoluci&oacute;n de estruvita</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Ayuda a disolver todos los tipos de c&aacute;lculos de fosfato inorg&aacute;nico (estruvita).</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Diluci&oacute;n urinaria</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			La diluci&oacute;n urinaria promueve un medio urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y de oxalato c&aacute;lcico.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-te