(5, 1, 'ROYAL CANIN VETERINARY EARLY RENAL PERRO 2KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Early Renal est&aacute; formulado espec&iacute;ficamente para ayudar a mantener la funci&oacute;n renal de tu perro en las primeras fases de la enfermedad renal. Esta dieta est&aacute; formulada con antioxidantes, EPA y DHA y con un contenido moderado de f&oacute;sforo para ayudar a mantener la funci&oacute;n renal de tu perro ante los primeros signos de deterioro. Los EPA y DHA son &aacute;cidos grasos omega 3 de cadena larga que ayudan a mantener una funci&oacute;n renal saludable. Esta dieta contiene una combinaci&oacute;n de antioxidantes para ayudar a neutralizar los efectos de los radicales libres y a proteger los tejidos y las c&eacute;lulas de tu perro. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition , solo debes dar este producto a tu mascota si te lo recomienda un veterinario. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Early Renal tambi&eacute;n est&aacute; disponible como alimento h&uacute;medo en forma de finas l&aacute;minas en salsa. * *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Soporte renal temprano</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Formulado con un contenido moderado de f&oacute;sforo, EPA+DHA y un complejo de antioxidantes para ayudar a la funci&oacute;n renal ante los primeros signos de deficiencia.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			EPA+DHA</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			EPA+DHA son &aacute;cidos grasos omega-3 de cadena larga que ayudan a mantener la funci&oacute;n renal.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Complejo antioxidante</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Enriquecido con una mezcla de antioxidantes para ayudar a neutralizar los radicales libres, contribuyendo a la protecci&oacute;n de los tejidos y c&eacute;lulas.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; EARLY RENAL seco es un alimento diet&eacute;tico completo para perros, formulado para ayudar a la funci&oacute;n renal en caso de insuficiencia renal cr&oacute;nica, mediante su contenido limitado de f&oacute;sforo y prote&iacute;nas de alta calidad. EARLY RENAL seco est&aacute; formulado para las fases m&aacute;s tempranas de la insuficiencia renal cr&oacute;nica.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: ma&iacute;z, prote&iacute;nas de ave deshidratadas, harina de trigo, arroz, trigo, grasas animales, gluten de ma&iacute;z, hidrolizado de prote&iacute;nas animales, pulpa de remolacha, gluten de trigo*, aceite de pescado, minerales, aceite de soja, sal de &aacute;cido but&iacute;rico, fructo-oligosac&aacute;ridos, extracto de rosa de la India (fuente de lute&iacute;na). Fuentes de prote&iacute;na: prote&iacute;nas de ave deshidratadas, gluten de ma&iacute;z, hidrolizado de prote&iacute;nas animales, gluten de trigo*<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 15500&nbsp;UI, Vitamina D3: 1000&nbsp;UI, Hierro (3b103): 58&nbsp;mg, Yodo (3b201, 3b202): 4,8&nbsp;mg, Cobre (3b405, 3b406): 12&nbsp;mg, Manganeso (3b502, 3b504): 60&nbsp;mg, Zinc (3b603, 3b605, 3b606): 136&nbsp;mg, Selenio (3b801, 3b811, 3b812): 0,14&nbsp;mg&nbsp;- Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 5&nbsp;g&nbsp;- Conservantes&nbsp;- Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 22,5%&nbsp;- Grasa bruta: 16,0%&nbsp;- Ceniza bruta: 5,1%&nbsp;- Fibra bruta: 1,5%&nbsp;- Calcio: 0,8%&nbsp;- F&oacute;sforo: 0,5%&nbsp;- Potasio: 0,6%&nbsp;- Sodio: 0,35%&nbsp;- &Aacute;cido graso esencial (&aacute;cido linoleico): 2,66%&nbsp;- EPA/DHA: 0,5%&nbsp;- &Aacute;cidos grasos omega 3: 0,86%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			*L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 22,5%&nbsp;- Grasa bruta: 16,0%&nbsp;- Ceniza bruta: 5,1%&nbsp;- Fibra bruta: 1,5%&nbsp;- Calcio: 0,8%&nbsp;- F&oacute;sforo: 0,5%&nbsp;- Potasio: 0,6%&nbsp;- Sodio: 0,35%&nbsp;- &Aacute;cido graso esencial (&aacute;cido linoleico): 2,66%&nbsp;- EPA/DHA: 0,5%&nbsp;- &Aacute;cidos grasos omega 3: 0,86%.</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 95);
