(8, 1, 'ROYAL CANIN VETERINARY GASTROINTESTINAL GATO 2KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Gastrointestinal est&aacute; formulado espec&iacute;ficamente para ayudar a mantener la salud digestiva de tu gato en casos de sensibilidad gastrointestinal. Su f&oacute;rmula de alta digestibilidad est&aacute; enriquecida con un contenido equilibrado de fibras y prebi&oacute;ticos para ayudar a mantener una digesti&oacute;n y un tr&aacute;nsito saludables. Esta dieta tiene un alto valor energ&eacute;tico para reducir el volumen de la raci&oacute;n y disminuir la carga intestinal de tu gato. Gracias a su f&oacute;rmula de alta palatabilidad, esta dieta esta espec&iacute;ficamente dise&ntilde;ada para fomentar la aceptaci&oacute;n del alimento en gatos con un apetito disminuido. Esta dieta tambi&eacute;n contribuye a un entorno urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y oxalato de calcio. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si te lo recomienda un veterinario . La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada gato, ROYAL CANIN&reg; Gastrointestinal tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo en finas l&aacute;minas en salsa. * *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Soporte digestivo</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			F&oacute;rmula altamente digestible con un aporte equilibrado de fibras, incluyendo prebi&oacute;ticos, para favorecer una digesti&oacute;n y un tr&aacute;nsito saludables.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Alta energ&iacute;a</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Un alto contenido energ&eacute;tico para reducir el volumen de la raci&oacute;n y disminuir la carga intestinal.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Alta palatabilidad</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Alta palatabilidad para satisfacer un apetito disminuido.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			&Iacute;ndice S/O</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta dieta promueve un entorno urinario desfavorable para la formaci&oacute;n de cristales, tanto de estruvita como de oxalato c&aacute;lcico.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; EARLY RENAL seco es un alimento diet&eacute;tico completo para perros, formulado para ayudar a la funci&oacute;n renal en caso de insuficiencia renal cr&oacute;nica, mediante su contenido limitado de f&oacute;sforo y prote&iacute;nas de alta calidad. EARLY RENAL seco est&aacute; formulado para las fases m&aacute;s tempranas de la insuficiencia renal cr&oacute;nica.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: prote&iacute;nas de ave deshidratadas*, arroz*, grasas animales*, gluten de trigo*, fibras vegetales, gluten de ma&iacute;z*, h&iacute;gado de ave hidrolizado*, minerales, huevo deshidratado*, pulpa de remolacha, aceite de pescado*, aceite de soja*, levadura de cerveza, semillas e integumentos de psyllium (fuente de sustancias mucilaginosas), fructo-oligosac&aacute;ridos (0,48%), hidrolizado de levaduras (fuente de manano-oligosac&aacute;ridos) (0,19%), extracto de rosa de la India (fuente de lute&iacute;na). *ingredientes altamente digestibles.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 21500&nbsp;UI, Vitamina D3: 800&nbsp;UI, Hierro (3b103): 41&nbsp;mg, Yodo (3b201, 3b202): 4,1&nbsp;mg, Cobre (3b405, 3b406): 13&nbsp;mg, Manganeso (3b502, 3b504): 54&nbsp;mg, Zinc (3b603, 3b605, 3b606): 132&nbsp;mg, Selenio (3b801, 3b811, 3b812): 0,08&nbsp;mg&nbsp;- Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 10&nbsp;g&nbsp;- Conservantes&nbsp;- Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 32,0%&nbsp;- Aceites y grasas brutos: 22,0%&nbsp;- Ceniza bruta: 8,5%&nbsp;- Fibras brutas: 4,9%&nbsp;- EPA/DHA: 0,33%&nbsp;- &Aacute;cidos grasos omega-3: 0,93%&nbsp;- &Aacute;cidos grasos omega-6: 4,4%&nbsp;- Sodio: 0,6%&nbsp;- Potasio: 1,0%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Dejar siempre agua a disposici&oacute;n. N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase. Para Argentina: Establecimiento inscripto en SENASA N&deg; 0073. Certificado SENASA N&deg; XXXXX.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 32,0%&nbsp;- Aceites y grasas brutos: 22,0%&nbsp;- Ceniza bruta: 8,5%&nbsp;- Fibras brutas: 4,9%&nbsp;- EPA/DHA: 0,33%&nbsp;- &Aacute;cidos grasos omega-3: 0,93%&nbsp;- &Aacute;cidos grasos omega-6: 4,4%&nbsp;- Sodio: 0,6%&nbsp;- Potasio: 1,0%.</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 98),
(7, 1, 'ROYAL CANIN VETERINARY GASTROINTESTINAL LOW FAT PERRO 1.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Gastrointestinal Low Fat est&aacute; formulado espec&iacute;ficamente para ayudar a mantener la salud digestiva de tu perro en casos de sensibilidad gastrointestinal. Su f&oacute;rmula de alta digestibilidad est&aacute; enriquecida con un contenido equilibrado de fibras y prebi&oacute;ticos para ayudar a mantener una digesti&oacute;n y un tr&aacute;nsito saludables. Esta dieta est&aacute; dise&ntilde;ada a medida para responder a &nbsp;las necesidades nutricionales de los perros que requieren una dieta baja en grasa. Contenido limitado en fibras para poder cubrir las necesidades energ&eacute;ticas de mantenimiento a pesar de la restricci&oacute;n de grasa. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Management, solo debes dar este producto a tu mascota si un veterinario te lo recomienda . La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Gastrointestinal Low Fat tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con una textura suave similar a la del pat&eacute;.* *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !importa