g: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Equilibrio de fibras</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Contenido limitado en fibras para poder cubrir las necesidades energ&eacute;ticas de mantenimiento pese a la restricci&oacute;n de grasa.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; GASTROINTESTINAL LOW FAT seco, es un alimento diet&eacute;tico completo para perros, formulado para regular el metabolismo de los l&iacute;pidos en caso de hiperlipidemia. Este alimento contiene un bajo nivel de grasas manteniendo un nivel elevado de &aacute;cidos grasos esenciales. RECOMENDACIONES: Se recomienda consultar a un veterinario antes de utilizarlo o de prolongar su periodo de utilizaci&oacute;n. Utilizar inicialmente GASTROINTESTINAL LOW FAT seco durante un periodo de hasta 2 meses en caso de hiperlipidemia.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: arroz, prote&iacute;nas de ave deshidratadas, trigo, cebada, hidrolizado de prote&iacute;nas animales, pulpa de remolacha, grasas animales, minerales, levadura de cerveza, aceite de pescado, mono- y diglic&eacute;ridos de &aacute;cidos palm&iacute;tico y este&aacute;rico esterificados con &aacute;cido c&iacute;trico, semillas e integumentos de psyllium, fructo-oligosac&aacute;ridos (0,48%), hidrolizado de levaduras (fuente de manano-oligosac&aacute;ridos) (0,19%), extracto de rosa de la India (fuente de lute&iacute;na).<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 16500&nbsp;UI, Vitamina D3: 1000&nbsp;UI, Hierro (3b103): 45&nbsp;mg, Yodo (3b201, 3b202): 4,5&nbsp;mg, Cobre (3b405, 3b406): 14&nbsp;mg, Manganeso (3b502, 3b504): 58&nbsp;mg, Zinc (3b603, 3b605, 3b606): 135&nbsp;mg, Selenio (3b801, 3b811, 3b812): 0,08&nbsp;mg&nbsp;- Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 5&nbsp;g&nbsp;- Conservantes&nbsp;- Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 22,0%&nbsp;- Aceites y grasas brutos: 7,0%&nbsp;- Ceniza bruta: 6,2%&nbsp;- Fibras brutas: 1,8%&nbsp;- &Aacute;cidos grasos esenciales: 1,25%&nbsp;- &Aacute;cidos grasos omega-3: 0,3%&nbsp;- EPA/DHA: 0,13%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Modo de empleo: ver tabla.Dejar siempre agua a disposici&oacute;n.N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase.Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 22,0%&nbsp;- Aceites y grasas brutos: 7,0%&nbsp;- Ceniza bruta: 6,2%&nbsp;- Fibras brutas: 1,8%&nbsp;- &Aacute;cidos grasos esenciales: 1,25%&nbsp;- 