(10, 1, 'ROYAL CANIN VETEROMARY ANALLERGENIC PERRO 8KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Anallergenic est&aacute; formulado espec&iacute;ficamente para ayudar a perros adultos con intolerancias y alergias alimentarias. Esta dieta est&aacute; formulada con una prote&iacute;na en forma de p&eacute;ptidos muy peque&ntilde;os y amino&aacute;cidos puros para minimizar el reconocimiento inmunitario y, por tanto, minimizar el riesgo de reacci&oacute;n adversa al alimento. Esta f&oacute;rmula se elabora espec&iacute;ficamente para minimizar la contaminaci&oacute;n y excluir las fuentes de al&eacute;rgenos alimentarios. Gracias a su combinaci&oacute;n de nutrientes de apoyo, esta f&oacute;rmula favorece la barrena protectora natural de la piel de tu perro. Esta f&oacute;rmula est&aacute; enriquecida con una combinaci&oacute;n sin&eacute;rgica de antioxidantes para ayudar a neutralizar los efectos de los radicales libres. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si te lo recomienda un veterinario . La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Prote&iacute;na extensamente hidrolizada</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			P&eacute;ptidos de bajo peso molecular para reducir el riesgo de intolerancias o alergias a nutrientes</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Restricci&oacute;n de al&eacute;rgenos</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			La f&oacute;rmula y el proceso de producci&oacute;n tienen como objetivo excluir las fuentes de al&eacute;rgenos alimentarios.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Barrera cut&aacute;nea</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Formulado para favorecer la barrera protectora natural de la piel para una salud cut&aacute;nea &oacute;ptima.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; ANALLERGENIC seco es un alimento diet&eacute;tico completo para perros, formulado para reducir las intolerancias a ingredientes y nutrientes. Fuentes seleccionadas de prote&iacute;nas y carbohidratos.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: almid&oacute;n de ma&iacute;z, hidrolizado de plumas de bajo peso molecular (fuente de L-amino&aacute;cidos y oligop&eacute;ptidos), aceite de copra, aceite de soja, minerales, fibras vegetales, pulpa de achicoria, fructo-oligosac&aacute;ridos, aceite de pescado, mono- y diglic&eacute;ridos de &aacute;cidos palm&iacute;tico y este&aacute;rico esterificados con &aacute;cido c&iacute;trico, grasa animal, extracto de rosa de la India (fuente de lute&iacute;na). Fuente de prote&iacute;na: hidrolizado de plumas de bajo peso molecular. Fuente de carbohidratos: almid&oacute;n de ma&iacute;z.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 36500 UI, Vitamina D3: 800 UI, E1 (Hierro): 42 mg, E2 (Yodo): 3,8 mg, E4 (Cobre): 15 mg, E5 (Manganeso): 55 mg, E6 (Zinc): 154 mg, E8 (Selenio): 0,26 mg - Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 8,48 g - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 18,0% - Grasa bruta: 16,5% - Ceniza bruta: 6,5% - Fibra bruta: 1,7% - &Aacute;cidos grasos esenciales (&Aacute;cido linoleico): 27,2 g/kg.&nbsp; Dejar siempre agua a disposici&oacute;n.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Dejar siempre agua a disposici&oacute;n. N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase. Para Argentina: Establecimiento inscripto en SENASA N&deg; 0073. Certificado SENASA N&deg; XXXXX.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 18,0% - Grasa bruta: 16,5% - Ceniza bruta: 6,5% - Fibra bruta: 1,7% - &Aacute;cidos grasos esenciales (&Aacute;cido linoleico): 27,2 g/kg.&nbsp; Dejar siempre agua a disposici&oacute;n.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizi