INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_short`, `products_description`, `products_cp_ce_menosnombre_1`, `products_cp_ce_menosnombre_2`, `products_cp_ce_menosnombre_3`, `products_add_1`, `products_url`, `products_viewed`) VALUES
(13, 1, 'ROYAL CANIN VETERINARY HYPOALLERGENIC SMALL DOG PERRO 3.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Hypoallergenic Small Dogs est&aacute; formulado espec&iacute;ficamente para ayudar a perros de razas peque&ntilde;as con intolerancias y alergias alimentarias o sensibilidades dermatol&oacute;gicas. Esta f&oacute;rmula contiene prote&iacute;nas hidrolizadas con un peso molecular bajo para garantizar una dieta de alta digestibilidad y baja alergenicidad, que favorece una mejor absorci&oacute;n de prote&iacute;nas y reduce el riesgo de reacci&oacute;n al&eacute;rgica. Esta dieta ayuda a disminuir la concentraci&oacute;n de iones que pueden favorecer la formaci&oacute;n de cristales en el tracto urinario, demostrado a trav&eacute;s de una baja SSR (supersaturaci&oacute;n relativa) obtenida en estudios. Formulado para favorecer la barrera protectora natural de la piel para ayudar a mantener una salud cut&aacute;nea &oacute;ptima. Esta f&oacute;rmula contiene nutrientes espec&iacute;ficos que ayudan a proteger y mantener la salud oral de tu perro. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si te lo recomienda un veterinario. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Hypoallergenic tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con una textura similar a la del pat&eacute;. * *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Prote&iacute;na hidrolizada</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Prote&iacute;na hidrolizada con un bajo peso molecular para garantizar que el alimento es hipoalerg&eacute;nico.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Baja SSR (sobresaturaci&oacute;n de orina relativa)</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Ayuda a reducir la concentraci&oacute;n de los iones que contribuyen a la formaci&oacute;n de los cristales.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Salud dental</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Contiene nutrientes espec&iacute;ficos que contribuyen al mantenimiento de una buena salud bucal.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Barrera cut&aacute;nea</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Formulado para favorecer la barrera protectora natural de la piel para una salud cut&aacute;nea &oacute;ptima.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; HYPOALLERGENIC SMALL DOG seco (menos de 10 kg) es un alimento diet&eacute;tico completo para perros, formulado para reducir las intolerancias a ingredientes y nutrientes. Fuentes seleccionadas de prote&iacute;nas y carbohidratos. RECOMENDACIONES: Se recomienda consultar a un veterinario antes de utilizarlo. Utilizar HYPOALLERGENIC SMALL DOG seco (menos de 10 kg) de 3 a 8 semanas. Si los signos de intolerancia desaparecen, este alimento puede utilizarse indefinidamente.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: arroz, hidrolizado de aislado proteico de soja, grasas animales, minerales, h&iacute;gado de ave hidrolizado, aceite de soja, pulpa de remolacha, aceite de pescado, fructo-oligosac&aacute;ridos, aceite de borraja, extracto de rosa de la India (fuente de lute&iacute;na). Fuentes de prote&iacute;na: hidrolizado de aislado proteico de soja, h&iacute;gado de ave hidrolizado. Fuente de carbohidratos: arroz.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 27000 UI, Vitamina D3: 800 UI, E1 (Hierro): 41 mg, E2 (Yodo): 3,7 mg, E4 (Cobre): 15 mg, E5 (Manganeso): 54 mg, E6 (Zinc): 153 mg, E8 (Selenio): 0,26 mg - Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 10 g - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-siz