(15, 1, 'ROYAL CANIN VETERINARY NEUTERED ADULT SMALL PERRO 8KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Beneficios: Peso ideal / Salud digestiva / Salud dental / Salud urinaria ROYAL CANIN&reg; Neutered Adult est&aacute; formulado especialmente para ayudar a mantener un peso &oacute;ptimo en perros de razas peque&ntilde;as esterilizados. Este alimento tiene un contenido cal&oacute;rico adaptado para ayudar a los perros peque&ntilde;os a mantener su peso ideal y una mezcla de fibras que favorece una sensaci&oacute;n de saciedad despu&eacute;s de las comidas. Este alimento de alta digestibilidad contiene prebi&oacute;ticos especialmente seleccionados para estimular y favorecer una digesti&oacute;n saludable. El efecto mec&aacute;nico de cepillado de las croquetas y la incorporaci&oacute;n &nbsp;de un agente quelante de calcio ayudan a retrasar la formaci&oacute;n de sarro. Este alimento tambi&eacute;n favorece la creaci&oacute;n de un entorno desfavorable para la formaci&oacute;n de cristales y c&aacute;lculos urinarios. La transici&oacute;n de un alimento a otro debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Es importante ofrecer la cantidad diaria correcta, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Neutered Adult tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con finas l&aacute;minas en salsa.* * Sujeto a la disponibilidad del producto</span></p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-siz