(16, 1, 'ROYAL CANIN VETERINARY NEUTERED ADULT SMALL PERRO 3.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Beneficios: Peso ideal / Salud digestiva / Salud dental / Salud urinaria ROYAL CANIN&reg; Neutered Adult est&aacute; formulado especialmente para ayudar a mantener un peso &oacute;ptimo en perros de razas peque&ntilde;as esterilizados. Este alimento tiene un contenido cal&oacute;rico adaptado para ayudar a los perros peque&ntilde;os a mantener su peso ideal y una mezcla de fibras que favorece una sensaci&oacute;n de saciedad despu&eacute;s de las comidas. Este alimento de alta digestibilidad contiene prebi&oacute;ticos especialmente seleccionados para estimular y favorecer una digesti&oacute;n saludable. El efecto mec&aacute;nico de cepillado de las croquetas y la incorporaci&oacute;n &nbsp;de un agente quelante de calcio ayudan a retrasar la formaci&oacute;n de sarro. Este alimento tambi&eacute;n favorece la creaci&oacute;n de un entorno desfavorable para la formaci&oacute;n de cristales y c&aacute;lculos urinarios. La transici&oacute;n de un alimento a otro debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Es importante ofrecer la cantidad diaria correcta, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Neutered Adult tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con finas l&aacute;minas en salsa.* * Sujeto a la disponibilidad del producto</span></p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Peso ideal</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			F&oacute;rmula y contenido cal&oacute;rico adaptados para ayudar a los perros a mantener un peso ideal. Formulado para favorecer la sensaci&oacute;n de saciedad con una mezcla de fibras.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Salud digestiva</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Una f&oacute;rmula altamente digestible con prebi&oacute;ticos para favorecer una digesti&oacute;n saludable.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Salud dental</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			El efecto mec&aacute;nico de la croqueta junto con la inclusi&oacute;n de quelantes de calcio ayudan a retrasar la formaci&oacute;n de sarro.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			S/O INDEX</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Este alimento promueve un entorno urinario desfavorable para la formaci&oacute;n de cristales tanto de estruvita como de oxalato c&aacute;lcico.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			Alimento diet&eacute;tico completo para perros adultos esterilizados o con tendencia al aumento de peso, de razas peque&ntilde;as (hasta 10 kg). Recomendaciones: Se recomienda consultar a un veterinario antes de utilizarlo.&nbsp;Utilizar inicialmente NEUTERED ADULT SMALL DOG seco durante un periodo de hasta 2 meses.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPOSICI&Oacute;N: arroz, prote&iacute;na de ave de corral deshidratada, ma&iacute;z, harina de trigo, grasas animales, gluten de trigo*, pulpa de achicoria, prote&iacute;na de cerdo deshidratada, prote&iacute;nas animales hidrolizadas, minerales, aceite de soja, aceite de pescado, fructo-oligosac&aacute;ridos (0,49%), harina de tagetes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			ADITIVOS (por kg): Aditivos nutricionales: Vitamina A: 29500 UI, Vitamina D3: 800 UI, Hierro (3b103): 43 mg, Yodo (3b201, 3b202): 4,3 mg, Cobre (3b405, 3b406): 13 mg, Manganeso (3b502, 3b504): 55 mg, Zinc (3b603, 3b605, 3b606): 132 mg, Selenio (3b801, 3b811, 3b812): 0,09 mg - Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 5 g - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 25,0% - Grasa bruta: 16,0% - Ceniza bruta: 7,5% - Fibra bruta: 1,5% - Calcio: 0,92% - Magnesio: 0,09% - Sodio: 0,9% - F&oacute;sforo: 0,7% - EPA/DHA: 0,3%. Energ&iacute;a metabolizable: 3871 kcal/kg<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Los animales deber&aacute;n tener acceso permanente al agua. N.&ordm; de lote, n.&ordm; de registro y fecha de consumo preferente: ver en el envase. Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 25,0% - Grasa bruta: 16,0% - Ceniza bruta: 7,5% - Fibra bruta: 1,5% - Calcio: 0,92% - Magnesio: 0,09% - Sodio: 0,9% - F&oacute;sforo: 0,7% - EPA/DHA: 0,3%. Energ&iacute;a metabolizable: 3871 kcal/kg</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						PESO DEL PERRO (kg)</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Normal</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						&nbsp;</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Sobrepeso</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						&nbsp;</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						&nbsp;</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						gramos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						vasos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						gramos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						vasos</td>\r\n				</tr>\r\n		