(18, 1, 'ROYAL CANIN VETERINARY CARDIAC PERRO 2KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Cardiac est&aacute; formulado espec&iacute;ficamente para ayudar a mantener la salud card&iacute;aca de tu perro. Esta dieta contiene nutrientes de apoyo como la taurina y la L-carnitina, que contribuyen al mantenimiento de la salud del m&uacute;sculo card&iacute;aco de tu perro. Esta f&oacute;rmula contiene &aacute;cidos grasos omega 3 EPA y DHA de cadena larga para ayudar a mantener una funci&oacute;n cardiovascular saludable. Esta dieta est&aacute; formulada con un bajo contenido en sodio para ayudar a reducir la carga de trabajo del coraz&oacute;n. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si un veterinario te lo recomienda . La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Cardiac tambi&eacute;n est&aacute; disponible como alimento h&uacute;medo con una textura suave similar a la del pat&eacute;*. *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 cla