, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Bajo en sodio</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Bajo en sodio para ayudar a reducir la carga de trabajo del coraz&oacute;n.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			ROYAL CANIN&reg; CARDIAC seco es un alimento diet&eacute;tico completo para perros, formulado para ayudar a la funci&oacute;n card&iacute;aca en caso de insuficiencia card&iacute;aca cr&oacute;nica.Esta dieta tiene un contenido limitado de sodio. Recomendaciones: Se recomienda consultar a un veterinario antes de utilizarlo o de prolongar su periodo de utilizaci&oacute;n.Utilizar inicialmente CARDIAC seco durante un periodo de hasta 6 meses</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: prote&iacute;na de ave de corral deshidratada,&nbsp;cebada,&nbsp;gluten de trigo*,&nbsp;gluten de ma&iacute;z,&nbsp;fibras vegetales,&nbsp;grasas animales,&nbsp;prote&iacute;nas animales hidrolizadas,&nbsp;pulpa de achicoria,&nbsp;productos de levaduras,&nbsp;minerales,&nbsp;semillas e integumentos de psyllium,&nbsp;aceite de pescado,&nbsp;mono- y diglic&eacute;ridos de &aacute;cidos palm&iacute;tico y este&aacute;rico esterificados con &aacute;cido c&iacute;trico,&nbsp;aceite de soja,&nbsp;harina de tagetes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales:&nbsp;Vitamina A:&nbsp;18554&nbsp;UI,&nbsp;Vitamina D3:&nbsp;964&nbsp;UI,&nbsp;Vitamina E:&nbsp;437&nbsp;mg,&nbsp;Vitamina C:&nbsp;178&nbsp;mg,&nbsp;Taurina:&nbsp;2,2&nbsp;g,&nbsp;Hierro (3b103):&nbsp;19&nbsp;mg,&nbsp;Yodo (3b201, 3b202):&nbsp;1,9&nbsp;mg,&nbsp;Cobre (3b405, 3b406):&nbsp;5,9&nbsp;mg,&nbsp;Manganeso (3b502, 3b504):&nbsp;25&nbsp;mg,&nbsp;Zinc (3b603, 3b605, 3b606):&nbsp;113&nbsp;mg,&nbsp;Selenio (3b801, 3b811, 3b812):&nbsp;0,05&nbsp;mg&nbsp;-&nbsp;Aditivos zoot&eacute;cnicos:&nbsp;Cloruro am&oacute;nico:&nbsp;5&nbsp;g&nbsp;-&nbsp;Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta:&nbsp;45,7%&nbsp;-&nbsp;Grasa bruta:&nbsp;13,0%&nbsp;-&nbsp;Ceniza bruta:&nbsp;6,9%&nbsp;-&nbsp;Fibra bruta:&nbsp;6,5%&nbsp;-&nbsp;Extracto libre de nitr&oacute;geno:&nbsp;22,4%&nbsp;-&nbsp;Magnesio:&nbsp;0,07%&nbsp;-&nbsp;Potasio:&nbsp;0,7%&nbsp;-&nbsp;Sodio:&nbsp;0,25%&nbsp;-&nbsp;EPA/DHA:&nbsp;0,27%&nbsp;-&nbsp;&Aacute;cidos grasos omega-3:&nbsp;0,58%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Modo de empleo: ver tabla.&nbsp;Los animales deber&aacute;n tener acceso permanente al agua.&nbsp;N.&ordm; de lote, n.&ordm; de registro y fecha de consumo preferente: ver en el envase.&nbsp;Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta:&nbsp;45,7%&nbsp;-&nbsp;Grasa bruta:&nbsp;13,0%&nbsp;-&nbsp;Ceniza bruta:&nbsp;6,9%&nbsp;-&nbsp;Fibra bruta:&nbsp;6,5%&nbsp;-&nbsp;Extracto libre de nitr&oacute;geno:&nbsp;22,4%&nbsp;-&nbsp;Magnesio:&nbsp;0,07%&nbsp;-&nbsp;Potasio:&nbsp;0,7%&nbsp;-&nbsp;Sodio:&nbsp;0,25%&nbsp;-&nbsp;EPA/DHA:&nbsp;0,27%&nbsp;-&nbsp;&Aacute;cidos grasos omega-3:&nbsp;0,58%.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n<body id=\"cke_pastebin\" style=\"position: absolute; top: 1196.67px; width: 1px; height: 1px; overflow: hidden; left: -1000px;\">\r\n	<p>\r\n		Adult weightDelgadoNormalSobrepesoPeso del perro (kg)gramscup(s)gramscup(s)gramscup(s)</p>\r\n</body>', '', '', '', '', '', 85),
(19, 1, 'ROYAL CANIN VETERINARY SATIET WEIGHT MANAGEMENT SMALL DOG PERRO 1.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Satiety Weight Management est&aacute; formulado espec&iacute;ficamente para favorecer la reducci&oacute;n de peso y el mantenimiento de un peso saludable en caso de sobrepeso en perros adultos de raza peque&ntilde;a. En los ensayos de un estudio de Royal Canin, un impresionante 97&nbsp;% de los perros perdieron peso en 3 meses comiendo ROYAL CANIN&reg; Satiety Weight Management. Un alto nivel de fibras naturales ayuda a que tu perro se sienta saciado entre las comidas. En los ensayos de un estudio, esta dieta ayud&oacute; a controlar la demanda de alimento en un 83% de los perros que estaban perdiendo peso. Esta f&oacute;rmula est&aacute; especialmente adaptada para dar respuesta a las sensibilidades digestiva, dental y urinaria espec&iacute;ficas de los perros de raza peque&ntilde;a. Esta dieta tambi&eacute;n contribuye a un entorno urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y oxalato de calcio. Como parte de la gama ROYAL CANIN&reg; Veterinary Range, solo debes dar este producto a tu mascota si te lo recomienda un veterinario. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Satiety Weight Management tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con una textura de pat&eacute; suave.* *Sujeto a la disponibilidad del producto</span></p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=