 fibras naturales ayuda a mantener la saciedad entre las comidas. Ayud&oacute; a controlar la demanda de alimento en el 83% de los perros durante el periodo de p&eacute;rdida de peso.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Espec&iacute;ficamente formulado para perros peque&ntilde;os</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			F&oacute;rmula adaptada para responder a las sensibilidades digestiva, oral y urinaria de los perros peque&ntilde;os.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			&Iacute;ndice S/O</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula provoca un entorno urinario desfavorable para la formaci&oacute;n de cristales tanto de estruvita como de oxalato c&aacute;lcico.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			SATIETY SMALL DOG es un alimento diet&eacute;tico completo para perros de razas peque&ntilde;as, formulado para reducir el exceso de peso. Este alimento se caracteriza por un bajo contenido energ&eacute;tico. RECOMENDACIONES: Utilizar SATIETY SMALL DOG hasta alcanzar el peso corporal objetivo.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: prote&iacute;nas de ave deshidratadas, fibras vegetales, gluten de trigo*, tapioca, pulpa de achicoria, hidrolizado de prote&iacute;nas animales, gluten de ma&iacute;z, trigo, ma&iacute;z, grasas animales, minerales, semillas e integumentos de psyllium, aceite de pescado, sal de &aacute;cido graso, fructo-oligosac&aacute;ridos, hidrolizado de crust&aacute;ceo (fuente de glucosamina), extracto de rosa de la India (fuente de lute&iacute;na), hidrolizado de cart&iacute;lago (fuente de condroitina).<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 19000 UI, Vitamina D3: 1000 UI, E1 (Hierro): 34 mg, E2 (Yodo): 3,4 mg, E4 (Cobre): 10 mg, E5 (Manganeso): 44 mg, E6 (Zinc): 136 mg, E8 (Selenio): 0,05 mg - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 30% - Grasa bruta: 9,5% - Ceniza bruta: 6,8% - Fibra bruta: 15,6% - Energ&iacute;a metabolizable: 2696.0 kcal/kg.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Los pesos indicados en la tabla son los pesos corporales perseguidos. Los animales deber&aacute;n tener acceso permanente al agua. N.&ordm; de lote, n.&ordm; de registro y fecha de consumo preferente: ver en el envase. Conservar en lugar fresco y seco. Para Argentina: firma inscripta en SENASA n.&ordm; 11902/A/E. Certificado SENASA n.&ordm; XXXXX.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 30% - Grasa bruta: 9,5% - Ceniza bruta: 6,8% - Fibra bruta: 15,6% - Energ&iacute;a metabolizable: 2696.0 kcal/kg.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso ideal (kg)</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Empezar</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Despu&eacute;s de 4 semanas</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Mantenimiento</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: i