(20, 1, 'ROYAL CANIN VETERINARY MATURE CONSULT SMALL DOGS PERRO 1.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Beneficios: Vitalidad y salud cerebral / Mantenimiento de la masa muscular / Salud dental / Salud urinaria ROYAL CANIN&reg; Mature Consult est&aacute; formulado especialmente para favorecer la salud y el bienestar de los perros s&eacute;nior de razas peque&ntilde;as. Esta f&oacute;rmula ofrece una selecci&oacute;n espec&iacute;fica de nutrientes que ayuda a mantener la vitalidad en los perros maduros. Esta f&oacute;rmula espec&iacute;ficamente equilibrada est&aacute; dise&ntilde;ada para ayudar a mantener la masa muscular de tu perro durante la etapa s&eacute;nior. Gracias al efecto mec&aacute;nico de cepillado de las croquetas y a la incorporaci&oacute;n de un agente quelante de calcio, ROYAL CANIN&reg; Mature Consult ayuda a retrasar la formaci&oacute;n y la acumulaci&oacute;n de sarro. Este alimento tambi&eacute;n favorece la creaci&oacute;n de un entorno desfavorable para la formaci&oacute;n de cristales y c&aacute;lculos urinarios. La transici&oacute;n de un alimento a otro &nbsp;debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Es importante ofrecer la cantidad diaria correcta, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, ROYAL CANIN&reg; Mature Consult tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con una textura de pat&eacute; suave.* * Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Vitalidad y salud cerebral</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			La edad puede afectar a los sistemas vitales de los perros, incluyendo las funciones renal, card&iacute;aca y cerebral. Esta f&oacute;rmula incluye una selecci&oacute;n de nutrientes que ayuda a mantener la vitalidad.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Mantenimineto de la masa muscular</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Una f&oacute;rmula espec&iacute;ficamente equilibrada para ayudar a mantener la masa muscular con la edad.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Salud dental</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			El efecto mec&aacute;nico de la croqueta junto con la inclusi&oacute;n de quelantes de calcio ayudan a retrasar la formaci&oacute;n de sarro.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			S/O INDEX</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Este alimento promueve un entorno urinario desfavorable para la formaci&oacute;n de cristales tanto de estruvita como de oxalato c&aacute;lcico.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			Alimento diet&eacute;tico completo para perros maduros de razas peque&ntilde;as (hasta 10 kg) - A partir de los 8 a&ntilde;os de edad. Recomendaciones: Se recomienda consultar a un veterinario antes de utilizarlo.&nbsp;Utilizar inicialmente MATURE CONSULT SMALL DOG seco durante un periodo de hasta 2 meses.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPOSICI&Oacute;N: ma&iacute;z, prote&iacute;na de ave de corral deshidratada, harina de trigo, trigo, fibras vegetales, grasas animales, prote&iacute;na de cerdo deshidratada, gluten de ma&iacute;z, prote&iacute;nas animales hidrolizadas, gluten de trigo*, minerales, pulpa de achicoria, aceite de pescado, aceite de soja, pulpa de tomate deshidratada (fuente de licopeno) (0,84%), fructo-oligosac&aacute;ridos, aceite de borraja, harina de tagetes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			ADITIVOS (por kg): Aditivos nutricionales: Vitamina A: 29500 UI, Vitamina D3: 800 UI, Hierro (3b103): 39 mg, Yodo (3b201, 3b202): 3,9 mg, Cobre (3b405, 3b406): 12 mg, Manganeso (3b502, 3b504): 50 mg, Zinc (3b603, 3b605, 3b606): 137 mg, Selenio (3b801, 3b811, 3b812): 0,08 mg - Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 5 g, Lecitina: 468 mg - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 25,5% 