INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_short`, `products_description`, `products_cp_ce_menosnombre_1`, `products_cp_ce_menosnombre_2`, `products_cp_ce_menosnombre_3`, `products_add_1`, `products_url`, `products_viewed`) VALUES
(23, 1, 'ROYAL CANIN VETERINARY URINARY S/O SMALL DOG PERRO 4KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Urinary S/O Small Dog est&aacute; formulado espec&iacute;ficamente para ayudar a perros de razas peque&ntilde;as con sensibilidades urinarias como los c&aacute;lculos y cristales de estruvita. Esta f&oacute;rmula ayuda a disolver cualquier tipo de c&aacute;lculo de estruvita que pueda formarse en la vejiga.&nbsp; Esta f&oacute;rmula contiene una baja SSR (sobresaturaci&oacute;n relativa) para ayudar a reducir la concentraci&oacute;n de iones que contribuyen a la formaci&oacute;n de cristales. Esta dieta ayuda a diluir la orina de tu perro, haciendo menos probable la formaci&oacute;n de c&aacute;lculos de estruvita o de oxalato de calcio. Esta f&oacute;rmula incluye nutrientes que atrapan el calcio presente en la saliva de tu perro lo que disminuye la formaci&oacute;n de sarro y ayuda a mantener una higiene bucal saludable. Esta dieta tambi&eacute;n contribuye a un entorno urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y oxalato de calcio. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si te lo recomienda un veterinario &nbsp;te lo recomienda. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada perro, el alimento h&uacute;medo ROYAL CANIN&reg; Urinary S/O tambi&eacute;n puede mezclarse con el alimento h&uacute;medo ROYAL CANIN&reg;&nbsp;Urinary S/O l&aacute;minas finas en salsa o pat&eacute;*. * Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Disoluci&oacute;n de estruvita</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Ayuda a disolver todo tipo de c&aacute;lculos de fosfato inorg&aacute;nico (estruvita).</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Baja SSR</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Ayuda a reducir la concentraci&oacute;n de los iones que intervienen en la formaci&oacute;n de cristales de estruvita y oxalato.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Diluci&oacute;n urinaria</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			La diluci&oacute;n urinaria promueve un medio urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y de oxalato c&aacute;lcico.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; font-size: 1.25rem; padding-bottom: 0.5rem; margin-bottom: 0px !important;\">\r\n			Control del sarro e &iacute;ndice s/o</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Nutriente que atrapa el calcio en la saliva con fin de reducir la formaci&oacute;n de los dep&oacute;sitos de sarro.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			Urinary S/O Small Dog es un alimento diet&eacute;tico completo para perros, formulado para disolver los c&aacute;lculos de estruvita y reducir su recurrencia, gracias a sus propiedades acidificantes de la orina, su bajo contenido en magnesio y contenido limitado de prote&iacute;nas, pero de alta calidad. RECOMENDACIONES: Se recomienda consultar a un veterinario antes de su utilizaci&oacute;n. Administrar Urinary S/O Small Dog durante 5-12 semanas para lograr la disoluci&oacute;n de los c&aacute;lculos de estruvita, y hasta 6 meses para reducir su recurrencia.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: Arroz, harina de ma&iacute;z, prote&iacute;nas de ave deshidratadas, grasas animales, gluten de ma&iacute;z, hidrolizado de prote&iacute;nas animales, minerales, fibras vegetales, huevo deshidratado, gluten de trigo**, aceite de soja, aceite de pescado, fructo-oligosac&aacute;ridos, extracto de Rosa de la India (fuente de lute&iacute;na). Fuentes de prote&iacute;na: prote&iacute;nas de ave deshidratadas, gluten de ma&iacute;z, hidrolizado de prote&iacute;nas animales, huevo deshidratado, gluten de trigo.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 16000 IU, Vitamina D3: 1000 IU, E1 (Hierro): 47 mg, E2 (Yodo): 4.7 mg, E4 (Cobre): 14 mg, E5 (Manganeso): 61 mg, E6 (Zinc): 148 mg, E8 (Selenio): 0.06 mg - Aditivos tecnol&oacute;gicos: Trifosfato pentas&oacute;dico: 3.5 g - Conservantes - Antioxidantes<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na: 20.0% -&nbsp; Grasas: 17.0% - Ceniza bruta: 7.3% - Fibra bruta: 2.3%- Calcio: 0.7% - F&oacute;sforo: 0.7%- Sodio: 1.2% - Potasio: 0.8% - Magnesio: 0.05% - Cloruro: 2% - Azufre: 0.5% - Sustancias urinarias acidificantes: sulfato de calcio(0.8%) - DL-Metionina (0.45%) - EPA and DHA : 0.22%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Dejar siempre agua a disposici&oacute;n. N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase. Para Argentina: Establecimiento inscripto en SENASA N&deg; 0073. Certificado SENASA N&deg; XXXXX.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na: 20.0% -&nbsp; Grasas: 17.0% - Ceniza bruta: 7.3% - Fibra bruta: 2.3%- Calcio: 0.7% - F&oacute;sforo: 0.7%- Sodio: 1.2% - Potasio: 0.8% - Magnesio: 0.05% - Cloruro: 2% - Azufre: 0.5% - Sustancias urinarias acidificantes: sulfato de calcio(0.8%) - DL-Metionina (0.45%) - EPA and DHA : 0.22%.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-si