(25, 1, 'ROYAL CANIN VETERINARY GASTROINTESTINAL KITTEN GATO 2KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Gastrointestinal Kitten est&aacute; formulado espec&iacute;ficamente para ayudar a mantener la salud digestiva de tu gatito en casos de sensibilidad gastrointestinal. Esta f&oacute;rmula de alta digestibilidad est&aacute; enriquecida con un contenido equilibrado de fibras solubles e insolubles, incluidos los prebi&oacute;ticos, para ayudar a mantener una digesti&oacute;n y un tr&aacute;nsito saludables. Esta f&oacute;rmula de alta energ&iacute;a contiene niveles espec&iacute;ficamente adaptados de nutrientes, como prote&iacute;na y calcio, para cubrir las necesidades nutricionales de crecimiento de tu gatito para un desarrollo saludable. Esta croqueta puede rehidratarse con gran facilidad para fomentar la aceptaci&oacute;n del alimento en gatitos con p&eacute;rdida de apetito. Tambi&eacute;n puede ayudar a facilitar la transici&oacute;n de la leche al alimento s&oacute;lido de tu gatito. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition , solo debes dar este producto a tu mascota si te lo recomienda un veterinario. La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes asegurarte de ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada gatito, ROYAL CANIN&reg; Gastrointestinal Kitten tambi&eacute;n est&aacute; disponible en forma de alimento h&uacute;medo con textura de mousse ultrasuave. * *Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Crecimiento &oacute;ptimo</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			F&oacute;rmula alta en energ&iacute;a con niveles adaptados de nutrientes&nbsp; (incluyendo prote&iacute;nas y calcio) para cubrir las necesidades&nbsp; del gatito en crecimiento.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			F&aacute;cil de rehidratar</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Croqueta que se rehidrata f&aa