&aacute;ridos (0,5%), hidrolizado de levaduras (fuente de manano-oligosac&aacute;ridos (0,2%) y betaglucanos), extracto de rosa de la India (fuente de lute&iacute;na). *ingredientes altamente digestibles.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 25500&nbsp;UI, Vitamina D3: 1000&nbsp;UI, Hierro (3b103): 31&nbsp;mg, Yodo (3b201, 3b202): 3,1&nbsp;mg, Cobre (3b405, 3b406): 10&nbsp;mg, Manganeso (3b502, 3b504): 41&nbsp;mg, Zinc (3b603, 3b605, 3b606): 127&nbsp;mg, Selenio (3b801, 3b811, 3b812): 0,04&nbsp;mg&nbsp;- Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 10&nbsp;g&nbsp;- Conservantes&nbsp;- Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componetes anal&iacute;ticos: Prote&iacute;na bruta: 35,0%&nbsp;- Aceites y grasas brutos: 24,0%&nbsp;- Ceniza bruta: 8,7%&nbsp;- Fibras brutas: 2,0%&nbsp;- Calcio: 1,25%&nbsp;- Potasio: 0,9%&nbsp;- Sodio: 0,7%&nbsp;- &Aacute;cidos grasos omega-6: 5,2%&nbsp;- &Aacute;cidos grasos omega-3: 1,2%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Modo de empleo: ver tabla.Dejar siempre agua a disposici&oacute;n.N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase.Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						&nbsp;</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Weight of cat</th>\r\n					<th style=\"box-si