(26, 1, 'ROYAL CANIN YORKSHIRE TERRIER ADULTO PERRO 500GR', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Cada raza tiene unos requerimientos espec&iacute;ficos, por eso la gama Breed Health Nutrition de ROYAL CANIN&reg; est&aacute; adaptada a las necesidades nutricionales espec&iacute;ficas de cada raza, favoreciendo un estado &oacute;ptimo de salud. Yorkshire Terrier Adult de ROYAL CANIN&reg; es un alimento indicado para yorkshire terriers de m&aacute;s de 10 meses, y ha sido espec&iacute;ficamente formulado teniendo en cuenta todas las necesidades nutricionales de tu perro adulto. Yorkshire Terrier Adult de ROYAL CANIN&reg; contribuye al mantenimiento de la salud del pelaje de tu yorkshire gracias a un contenido adaptado de &aacute;cidos grasos esenciales omega 3 (EPA y DHA), &aacute;cidos grasos omega 6, aceite de borraja y biotina. Yorkshire Terrier Adult de ROYAL CANIN&reg; es capaz de satisfacer incluso los apetitos m&aacute;s exigentes gracias a una combinaci&oacute;n exclusiva de aromas. En la elecci&oacute;n del alimento para tu perro, un aspecto importante a tener en cuenta, es que favorezca su higiene oral. Yorkshire Terrier Adult de ROYAL CANIN&reg; ayuda a reducir la formaci&oacute;n y ac&uacute;mulo de sarro gracias al aporte de quelantes de calcio Para adaptarse a las preferencias individuales de cada perro, Yorkshire Terrier de ROYAL CANIN&reg; tambi&eacute;n est&aacute; disponible en formato de alimento h&uacute;medo en forma de apetecible pat&eacute;. Si deseas proporcionar a tu perro una alimentaci&oacute;n mixta, sigue nuestras pautas de alimentaci&oacute;n para garantizar que recibe la cantidad precisa de ambos alimentos y as&iacute; aprovechar todos sus beneficios.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Pelo sano</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula exclusiva contribuye a mantener la salud del pelo largo del Yorkshire. Enriquecida con niveles adaptados de &aacute;cidos grasos omega 3 (EPA y DHA), &aacute;cidos grasos omega 6, aceite de borraja y biotina.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Satisface el apetito caprichoso</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !imp