td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						56 g (5/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						3 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						55 g (5/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						64 g (6/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						3.5 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						62 g (6/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						72 g (7/8 vaso)</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 30),
