 style=\"box-sizing: inherit;\">\r\n						54 g (5/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						62 g (6/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						71 g (7/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						4 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						67 g (7/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						77 g (1 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						88 g (1+1/8 vaso)</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 26),
(34, 1, 'ROYAL CANIN ADULT MALTESE PERRO 1.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Maltese Adult de ROYAL CANIN&reg; es un alimento indicado para malteses a partir de 10 meses y ha sido espec&iacute;ficamente formulado teniendo en cuenta las necesidades nutricionales de tu perro adulto. La nutrici&oacute;n es muy importante para la salud de la piel y el pelaje, por eso Maltese Adult de ROYAL CANIN&reg; aporta nutrientes espec&iacute;ficamente adaptados, entre los que se incluyen &aacute;cidos grasos esenciales omega 3, para mantener el pelo de tu malt&eacute;s lustroso y brillante. Los malteses pueden llegar a ser muy exigentes a la hora de comer. Requieren un alimento apetecible; por eso, Maltese Adult de ROYAL CANIN&reg; es capaz de satisfacer incluso los apetitos m&aacute;s exigentes gracias a una combinaci&oacute;n exclusiva de aromas. Adem&aacute;s, Maltese Adult de ROYAL CANIN&reg; ayuda a reducir el mal olor y volumen de las heces, gracias a una f&oacute;rmula nutricional que favorece la salud digestiva de tu perro. Los malteses tienen una mand&iacute;bula estrecha con dientes fuertes y anchos. Los perros peque&ntilde;os tienen una mayor predisposici&oacute;n al ac&uacute;mulo de sarro respecto a los perros grandes; por eso es importante que su dieta favorezca su salud dental. Gracias a la inclusi&oacute;n de quelantes de calcio, la formulaci&oacute;n de la croqueta de Maltese Adult de ROYAL CANIN&reg; favorece la salud de la higiene dental de tu perro ralentizando la formaci&oacute;n de sarro.</span></p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Pelaje saludable</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula exclusiva ayuda a mantener la salud del largo manto del Malt&eacute;s, en constante crecimiento, gracias a la acci&oacute;n del aceite de borraja y a la biotina y a los niveles adaptados de &aacute;cidos grasos Omega 3 (EPA y DHA) y Omega 6.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Reducci&oacute;n del olor y el volumen de las heces</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula ayuda a reducir el olor y el volumen de las heces.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Satisface los apetitos exigentes</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Satisface incluso a los m&aacute;s caprichosos, gracias a la excepcional combinaci&oacute;n de aromas.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Croqueta exclusiva: salud dental</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Ayuda a reducir la formaci&oacute;n del sarro gracias a una croqueta especialmente adaptada y a los quelantes de calcio.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: ma&iacute;z, arroz, prote&iacute;nas de ave deshidratadas, grasas animales, hidrolizado de prote&iacute;nas animales, prote&iacute;nas de cerdo deshidratadas, harina de ma&iacute;z, aislado de prote&iacute;nas vegetales*, pulpa de achicoria, aceite de soja, aceite de pescado, levaduras completas y partes de las mismas, minerales, fructo-oligosac&aacute;ridos, aceite de borraja (0,1%), extracto de rosa de la India (fuente de lute&iacute;na), hidrolizado de crust&aacute;ceo (fuente de glucosamina), hidrolizado de cart&iacute;lago (fuente de condroitina).<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Aditivos (por kg): Aditivos nutricionales: Vitamina A: 29500 UI, Vitamina D3: 800 UI, Biotina: 3 mg, E1 (Hierro): 64 mg, E2 (Yodo): 5,7 mg, E4 (Cobre): 15 mg, E5 (Manganeso): 72 mg, E6 (Zinc): 143 mg, E8 (Selenio): 0,15 mg - Aditivos tecnol&oacute;gicos: Clinoptilolita de origen sedimentario: 5 g - Aditivos organol&eacute;pticos: Extracto de t&eacute; (fuente de polifenoles): 150 mg - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 24,0% - Grasa bruta: 18,0% - Ceniza bruta: 5,6% - Fibra bruta: 1,5% - Por kg: &Aacute;cidos grasos omega 6: 39,1 g - &Aacute;cidos grasos omega 3: 8,1 g incluyendo EPA/DHA: 3 g - Trifosfato pentas&oacute;dico: 3,5 g.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			*L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Modo de empleo: ver tabla. N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase. Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 24,0% - Grasa bruta: 18,0% - Ceniza bruta: 5,6% - Fibra bruta: 1,5% - Por kg: &Aacute;cidos grasos omega 6: 39,1 g - &Aacute;cidos grasos omega 3: 8,1 g incluyendo EPA/DHA: 3 g - Trifosfato pentas&oacute;dico: 3,5 g.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso del perro</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						De interior - sin ejercicio</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Actividad normal</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Alta actividad</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						2 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						40 g (4/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						46 g (5/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						52 g (5/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						3 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						54 g (5/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						62 g (6/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						71 g (7/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						4 kg</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						67 g (7/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						77 g (1 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						88 g (1+1/8 vaso)</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 27);
INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_short`, `products_description`, `products_cp_ce_menosnombre_1`, `products_cp_ce_menosnombre_2`, `products_cp_ce_menosnombre_3`, `products_add_1`, `products_url`, `products_viewed`) VALUES
(35, 1, 'ROYAL CANIN VETERINARY URINARY S/O GATO 85GR', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">ROYAL CANIN&reg; Urinary S/O est&aacute; formulado espec&iacute;ficamente para ayudar a gatos con sensibilidades urinarias como los c&aacute;lculos y cristales de estruvita. El alto contenido en humedad de este alimento h&uacute;medo favorece la diluci&oacute;n urinaria en gatos con cistitis idiop&aacute;tica o recurrente. Esta f&oacute;rmula ayuda a disolver cualquier tipo de c&aacute;lculo de estruvita que pueda formarse en la vejiga. Esta f&oacute;rmula contiene una baja SSR (sobresaturaci&oacute;n relativa) para reducir la concentraci&oacute;n de iones que contribuyen a la formaci&oacute;n de cristales. Esta dieta ayuda a diluir la orina de tu gato, haciendo menos probable la formaci&oacute;n de c&aacute;lculos de estruvita o de oxalato de calcio. ROYAL CANIN&reg; Urinary S/O tambi&eacute;n contribuye a un entorno urinario desfavorable para el desarrollo de c&aacute;lculos de estruvita y oxalato de calcio. Como parte de la gama ROYAL CANIN&reg; Veterinary Health Nutrition, solo debes dar este producto a tu mascota si te lo recomienda un veterinario . La transici&oacute;n de tu mascota de una dieta a otra debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Debes ofrecer las raciones correctas, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada gato, el alimento h&uacute;medo ROYAL CANIN&reg; Urinary S/O tambi&eacute;n est&aacute; disponible en forma de bocaditos en salsa o en forma de alimento seco con croquetas crujientes*. * Sujeto a la disponibilidad del producto</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Cistitis idiop&aacute;tica</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Gracias al alto contenido de humedad del alimento h&uacute;medo, Urinary S/O aumenta la diluci&oacute;n urinaria. Puesto que alrededor del 64% de los casos de FLUTD son cistitis idiop&aacute;tica, es recomendable una dieta h&uacute;meda en casos de cistitis recurrentes.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Disoluci&oacute;n de estruvita</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Disuelve con eficacia los c&aacute;lculos de fosfato inorg&aacute;nico (estruvita).</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Bajo nivel de SSR</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Una orina subsaturada crea un entorno desfavorable para la formaci&oacute;n y multiplicaci&oacute;n de c&aacute;lculos de estruvita y oxalato c&aacute;lcico.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Diluci&oacute;n urinaria</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Diluir la orina reduce la concentraci&oacute;n urinaria de estruvita y de oxalato c&aacute;lcico. Un mayor volumen urinario tambi&eacute;n ayuda a asegurar un vaciado m&aacute;s frecuente de la vejiga.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			URINARY S/O es un alimento diet&eacute;tico completo para gatos, formulado para la disoluci&oacute;n de c&aacute;lculos de fosfato inorg&aacute;nico y la reducci&oacute;n de la reaparici&oacute;n de c&aacute;lculos de fosfato inorg&aacute;nico, mediante sus propiedades de acidificaci&oacute;n de la orina.RECOMENDACIONES: Se recomienda consultar a un veterinario antes de utilizarlo. Utilizar URINARY S/O de 5 a 12 semanas para la disoluci&oacute;n de c&aacute;lculos de fosfato inorg&aacute;nico y hasta 6 meses para reducir la reaparici&oacute;n de c&aacute;lculos de fosfato inorg&aacute;nico. Dejar siempre agua a disposici&oacute;n.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Composici&oacute;n: Carnes y subproductos animales, subproductos de origen vegetal, sustancias minerales, cereales, extractos de prote&iacute;nas vegetales, aceites y grasas, az&uacute;cares.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			ADITIVOS (por kg): Aditivos nutricionales: Vitamina D3: 50 UI, E1 (Hierro): 3 mg, E2 (Yodo): 0,3 mg, E4 (Cobre): 2,5 mg, E5 (Manganeso): 0,9 mg, E6 (Zinc): 9 mg - Aditivos tecnol&oacute;gicos: (regulador de acidez) Bisulfato de sodio: 0,5 g.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 11,0% - Grasa bruta: 3,5% - Ceniza bruta: 2,2% - Fibra bruta: 1,0% - Humedad: 79,5% - Taurina (total): 0,1% - Calcio: 0,25% - F&oacute;sforo: 0,25% - Sodio: 0,3% - Magnesio: 0,016% - Potasio: 0,22% - Cloruro: 0,4% - Azufre: 0,23% - Sustancias acidificantes de la orina: Sulfato de calcio: 0,35% - DL-metionina: 0,029%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			* L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. N.&ordm; de lote, n.&ordm; de registro y fecha de consumo preferente: ver en el envase. Conservar en lugar fresco y seco. Para Argentina: firma inscripta en SENASA n.&ordm; 11902/A/E. Certificado SENASA n.&ordm; XXXXX.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 11,0% - Grasa bruta: 3,5% - Ceniza bruta: 2,2% - Fibra bruta: 1,0% - Humedad: 79,5% - Taurina (total): 0,1% - Calcio: 0,25% - F&oacute;sforo: 0,25% - Sodio: 0,3% - Magnesio: 0,016% - Potasio: 0,22% - Cloruro: 0,4% - Azufre: 0,23% - Sustancias acidificantes de la orina: Sulfato de calcio: 0,35% - DL-metionina: 0,029%.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso del gato</th>\r\n					<th style=\"box-siz