za bruta: 7,2% - Fibra bruta: 2,0%.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			*L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			Modo de empleo: ver tabla. N&deg; de lote, n&deg; de registro y fecha de utilizaci&oacute;n preferente: ver en el envase. Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na bruta: 30,0% - Grasa bruta: 20,0% - Ceniza bruta: 7,2% - Fibra bruta: 2,0%.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						Edad (meses)</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso adulto = 1 kg</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso adulto = 2 kg</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso adulto = 3.5 kg</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						2 m</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						29 g (3/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						49 g (4/8 vaso)</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						71 g (6/8 vaso)</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						3 m</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						32 g (