(39, 1, 'ROYAL CANIN VETERINARY NEUTERED SATIETY BALANCE GATO 3.5KG', '', '<p>\r\n	<span style=\"color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px;\">Beneficios: Alto en fibra / Peso &oacute;ptimo / Salud urinaria ROYAL CANIN&reg; Neutered Satiety Balance est&aacute; formulado especialmente para satisfacer las necesidades nutricionales de los gatos esterilizados. Esta f&oacute;rmula contiene un alto nivel de fibras solubles e insolubles para ayudar a regular el apetito de tu gato y a que se sienta lleno y satisfecho despu&eacute;s de las comidas.&nbsp; ROYAL CANIN&reg; Neutered Satiety Balance ofrece un contenido moderado de grasas y calor&iacute;as para ayudar a tu gato a mantener un peso corporal y una masa muscular ideales y la masa muscular. Este alimento tambi&eacute;n favorece la creaci&oacute;n de un entorno desfavorable para la formaci&oacute;n de cristales y c&aacute;lculos urinarios. La transici&oacute;n de un alimento a otro debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Es importante ofrecer la cantidad diaria correcta, particularmente si la alimentaci&oacute;n es mixta. Para satisfacer las preferencias individuales de cada gato, hay disponible un producto similar de alimento h&uacute;medo llamado ROYAL CANIN&reg; Neutered Balance*. * Sujeto a la disponibilidad del producto Beneficios: Alto en fibra / Peso &oacute;ptimo / Salud urinaria ROYAL CANIN&reg; Veterinary Health Nutrition Desde 1968, en Royal Canin hemos cre&iacute;do en la importancia que tiene la nutrici&oacute;n para favorecer la salud y el bienestar de los gatos y los perros.&nbsp;Por eso hemos dise&ntilde;ado la gama ROYAL CANIN&reg; ROYAL CANIN&reg; Veterinary Health Nutrition bas&aacute;ndonos&nbsp; en una ciencia nutricional contrastada y en colaboraci&oacute;n con veterinarios, ofreciendo nuestra mejor nutrici&oacute;n para gatos y perros con necesidades de salud espec&iacute;ficas. Favorece la salud de tu gato con ROYAL CANIN&reg; Neutered Satiety Balance Un alimento dise&ntilde;ado a medida con un equilibrio perfecto de nutrientes que ayudan a tu gato esterilizado a mantener un peso &oacute;ptimo y una masa muscular saludable. ROYAL CANIN&reg; Neutered Satiety Balance est&aacute; formulado especialmente para satisfacer las necesidades nutricionales de los gatos esterilizados. Alto en fibra: Esta f&oacute;rmula contiene un alto nivel de fibras solubles e insolubles para ayudar a regular el apetito de tu gato y a que se sienta lleno y satisfecho despu&eacute;s de las comidas.&nbsp; Peso &oacute;ptimo: Gracias a su contenido moderado de grasas y calor&iacute;as y a su nivel de prote&iacute;nas especialmente adaptado, ROYAL CANIN&reg; Neutered Satiety Balance ayuda a tu gato a mantener un peso ideal y la masa muscular Salud urinaria: Los gatos esterilizados tienen mayor riesgo de desarrollar cristales y c&aacute;lculos urinarios. Este alimento tambi&eacute;n favorece la creaci&oacute;n de un entorno desfavorable para la formaci&oacute;n de cristales y c&aacute;lculos urinarios. Aviso importante: La transici&oacute;n de un alimento a otro debe realizarse de forma lenta y gradual durante un per&iacute;odo de 7 a 10 d&iacute;as. Es importante ofrecer la cantidad diaria correcta, particularmente si la alimentaci&oacute;n es mixta. Opciones de alimentaci&oacute;n mixta: Para satisfacer las preferencias individuales de cada gato, hay disponible un producto similar de alimento h&uacute;medo llamado ROYAL CANIN&reg; Neutered Balance*. La alimentaci&oacute;n mixta proporciona a tu gato una variedad de texturas, que ayudan a estimular su apetito. El alimento h&uacute;medo ofrece un aroma m&aacute;s intenso y su contenido de humedad a ayuda a mantener hidratada a tu mascota, mientras que el alimento seco es m&aacute;s c&oacute;modo de tomar y favorece m&aacute;s la salud dental.&nbsp; * Sujeto a la disponibilidad del producto</span></p>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Alto en fibra</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Se ha demostrado que esta f&oacute;rmula reduce la ingesta espont&aacute;nea de calor&iacute;as gracias a fibras que regulan el apetito.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			Peso &oacute;ptimo</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Un contenido moderado de grasa y calor&iacute;as ayuda a los gatos a mantener un peso ideal. Un nivel adaptado de prote&iacute;na ayuda a mantener la masa muscular.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			S/O INDEX</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Este alimento promueve un entorno urinario desfavorable para la formaci&oacute;n de cristales tanto de estruvita como de oxalato c&aacute;lcico.</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			MIX FEEDING SENTENCE</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			*Otros productos h&uacute;medos de ROYAL CANIN&reg; pueden ser compatibles con esta f&oacute;rmula para una alimentaci&oacute;n mixta. Consulta a tu veterinario</p>\r\n	</div>\r\n</div>\r\n<div class=\"rc-template__benefit-item rc-margin-x--none rc-padding-bottom--md--desktop rc-padding-bottom--md--mobile rc-padding-x--sm--desktop  \" style=\"box-sizing: inherit; padding-left: 2rem; padding-right: 2rem; padding-bottom: 2.5rem; color: rgb(102, 102, 102); font-family: &quot;RC TYPE&quot;, Roboto, Avenir, Helvetica, Arial, sans-serif; font-size: 16px; margin-right: 0px !important; margin-left: 0px !important;\">\r\n	<div class=\"rc-padding-x--none--mobile \" style=\"box-sizing: inherit;\">\r\n		<h3 class=\"rc-delta rc-margin-y--none rc-padding-bottom--sm--mobile rc-padding-bottom--xs--desktop\" style=\"box-sizing: inherit; color: rgb(226, 0, 26); font-weight: 300; line-height: 2rem; margin-top: 0px; margin-bottom: 0px !important; font-size: 1.25rem; padding-bottom: 0.5rem;\">\r\n			&Iacute;NDICE S/O</h3>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			Esta f&oacute;rmula provoca un entorno urinario desfavorable para la formaci&oacute;n de cristales tanto de c&aacute;lculos de fosfato inorg&aacute;nico (estruvita) como de oxalato c&aacute;lcico.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p style=\"box-sizing: inherit;\">\r\n			Alimento diet&eacute;tico completo para gatos adultos esterilizados o con tendencia al aumento de peso - Desde la esterilizaci&oacute;n hasta los 7 a&ntilde;os de edad. Recomendaciones: Se recomienda consultar a un veterinario antes de utilizarlo o de prolongar su per&iacute;odo de utilizaci&oacute;n.&nbsp;Utilizar inicialmente NEUTERED SATIETY BALANCE seco durante un periodo de hasta 6 meses.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPOSICI&Oacute;N: prote&iacute;na de ave de corral deshidratada, ma&iacute;z, fibras vegetales, gluten de trigo*, trigo, gluten de ma&iacute;z, prote&iacute;nas animales hidrolizadas, minerales, grasas animales, pulpa de achicoria, aceite de pescado, semillas e integumentos de psyllium (0,5%), harina de tagetes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			ADITIVOS (por kg): Aditivos nutricionales: Vitamina A: 25500 UI, Vitamina D3: 1000 UI, Hierro (3b103): 32 mg, Yodo (3b201, 3b202): 3,2 mg, Cobre (3b405, 3b406): 10 mg, Manganeso (3b502, 3b504): 41 mg, Zinc (3b603, 3b605, 3b606): 126 mg, Selenio (3b801, 3b811, 3b812): 0,06 mg - Conservantes - Antioxidantes.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 35,0% - Grasa bruta: 10,0% - Ceniza bruta: 9,1% - Fibra bruta: 9,7% - F&oacute;sforo: 1,13% - Sodio: 0,91% - Magnesio: 0,08% - L-carnitina: 200 mg/kg. Energ&iacute;a metabolizable: 3352 kcal/kg.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			*L.I.P.: prote&iacute;na seleccionada por su elevada digestibilidad.<br style=\"box-sizing: inherit;\" />\r\n			<br style=\"box-sizing: inherit;\" />\r\n			MODO DE EMPLEO: ver tabla. Los animales deber&aacute;n tener acceso permanente al agua. N.&ordm; de lote, n.&ordm; de registro y fecha de consumo preferente: ver en el envase. Conservar en lugar fresco y seco.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			COMPONENTES ANAL&Iacute;TICOS: Prote&iacute;na bruta: 35,0% - Grasa bruta: 10,0% - Ceniza bruta: 9,1% - Fibra bruta: 9,7% - F&oacute;sforo: 1,13% - Sodio: 0,91% - Magnesio: 0,08% - L-carnitina: 200 mg/kg. Energ&iacute;a metabolizable: 3352 kcal/kg.</p>\r\n		<p class=\"rc-margin-y--none\" style=\"box-sizing: inherit; margin-bottom: 0px !important; margin-top: 0px !important;\">\r\n			&nbsp;</p>\r\n		<table style=\"box-sizing: inherit;\">\r\n			<thead style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<th style=\"box-sizing: inherit;\">\r\n						Peso del gato (kg)</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Normal</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						&nbsp;</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						Sobrepeso</th>\r\n					<th style=\"box-sizing: inherit;\">\r\n						&nbsp;</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody style=\"box-sizing: inherit;\">\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						&nbsp;</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						gramos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						vasos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						gramos</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						vasos</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						2</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						38</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						1/2</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						30</td>\r\n					<td style=\"box-sizing: inherit;\">\r\n						1/2</td>\r\n				</tr>\r\n				<tr style=\"box-sizing: inherit;\">\r\n					<td style=\"box-sizing: inherit;\">\r\n						2,5<